INSERT INTO `wiki_version` VALUES (2,1,1328031275,0,'You can try out Wiki in here.\n\nHave fun :-)','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(3,1,1328031275,0,'WikiPlugin to let users attach comments to the end of a page. Since v1.3.8.\nChange the layout via the templates comment.tmpl and addcomment.tmpl, and the CSS classes\nwikicomment, wikicomment-header, wikicomment-body, wikicomment-footer\n\n!! Usage\n<verbatim>\n     <?plugin AddComment order||=normal jshide||=0 mode||=show,add noheader||=0 ?>\n</verbatim>\n\n!! Plugin Arguments\n__jshide__: |\n  Boolean if the comments and/or textbox should be initially hidden and on click expanded. Default: 0\n__order__:  |\n  List comments in chronological (order=normal) or reverse order (order=reverse)\n__mode__:  |\n  List of add and/or show.  Default: add,show\n__noheader__:  |\n  Boolean if the \"Comments\" h2 header should be omitted. Default: 0\n__pagename__:  |\n  Attach to which page? Default: current pagename\n\n!! Known Problems\n\njshide does not work yet. Not very well tested.\n\n!! Examples\n\n<?plugin AddComment jshide||=1 ?>\n\n-------------\n\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(6,1,1328031275,0,'Here is the list of all pages on this Wiki, including any\nOrphanedPages which are otherwise inaccessible.\n\n<?plugin AllPages?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(8,1,1328031275,0,'<?plugin AppendText ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(9,1,1328031275,0,'AppendText is a WikiPlugin to automatically add text to a page. For general\nusage better use the AddCommentPlugin.\n\n<verbatim>\n<?plugin AppendText ?>\n</verbatim>\n\n!! Plugin Arguments\n__page__: |\n  Append to which page. Default: Current page.\n__s__:  |\n  What text to add. Note: A \\n is always prepended.\n__before__:  |\n  (Optional) Add before the matching line beginning with before.\n__after__:  |\n  (Optional) Add after the matching line beginning with after.\n\n!! Examples\n\nAdd from a list of all available plugins one to the current page.\n<verbatim>\n  <?plugin WikiFormRich action=AppendText buttontext=\"AddPlugin\"\n  	   pulldown[] name=s text=\"Plugins: \" value=<!plugin-list BackLinks page=WikiPlugin !>\n  	   ?>\n</verbatim>\n\nAdd from a list of all available Categories to the current page.\n<verbatim>\n  <?plugin WikiFormRich action=AppendText buttontext=\"AddCategory\"\n  	   pulldown[] name=s text=\"Categories: \" value=<!plugin-list TitleSearch s=Category !>\n  	   ?>\n</verbatim>\n----\nPhpWikiDocumentation','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(10,1,1328031275,0,'This plugin allows you to list the history of edits by a particular\nauthor; you can specify the page name as well (default is the current\npage).\n\n<verbatim>\n<?plugin AuthorHistory user=\"test\" ?>\n\n<?plugin AuthorHistory page=HomePage ?>\n</verbatim>\n\nThe second example will default to the current page. We can\'t provide\nexamples for you since we don\'t know any potential usernames for your\nwiki.\n\n-------------\n\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(11,1,1328031275,0,'The contents of all pages are searched to find links to the current\npage. The BackLinks function also answers the question: \"Which pages\ncontain the title of this page?\".\n\n----\n\n<?plugin BackLinks exclude||=\'\' include_self||=1 noheader||=0 page||=\'\' info||=\'\' ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(12,1,1328031275,0,'The CalendarListPlugin is used in conjunction with the CalendarPlugin. It was written for those who use a wiki as a personal information manager.\n\nJust click any date in the calendar, edit the for that date, then come back to this page. The event should be listed below the calendar.\n\nUsage:\n<verbatim>\n<?plugin Calendar ?>\n<?plugin CalendarList ?>\n</verbatim>\n\nExample (click any date and edit it, then return to this page):\n<?plugin Calendar ?>\n\n<?plugin CalendarList ?>\n\n-----\n\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(13,1,1328031276,0,'The CalendarPlugin can be used to generate a monthly calendar in a\nwiki page. It\'s handy for PersonalWiki~s.\n\nIndividual dates in the calendar link to specially named wiki pages.\nThe names for the \"day pages\" are by default formed by appending the\ndate to the pagename on which the calendar appears.\n\n_This feature was inspired by [Manila|http://manila.userland.com/],\nand first implemented by GaryBenson. It was later implemented as a\nWikiPlugin by JeffDairiki._\n\n!!Usage:\n\n<verbatim>\n<?plugin Calendar?>\n</verbatim>\n\nwill get you:\n<?plugin Calendar?>\n\n--------\n\n!! Plugin Arguments\n\n!Selection of Month\n\n<strong>year</strong>:\n\n  Specify the year for the calendar.  (Default: current year.)\n\n<strong>month</strong>:\n\n  Specify the month for the calendar.  (Default: current month.)\n\n<strong>month_offset</strong>:\n\n  Added to \'\'month\'\'. Can be used to include several months worth of\n  calendars on a single wiki page.\n\n  <?plugin Calendar month_offset=+1?>\n\n!\"Day Page\" Names\n\n<strong>date_format</strong>:\n\n  [Strftime| php-function:strftime] style format string used to\n  generate page names for the \"day pages.\" The default value is\n  =%Y-%m-%d=.\n\n<strong>prefix</strong>:\n\n  Prepended to the date (formatted per \'\'date_format\'\') to generate\n  the \"day page\" names. The default value is =~[pagename]/=.\n\n!Appearance\n\n<strong>month_format</strong>:\n\n  [Strftime| php-function:strftime] style format string used to\n  generate the title of the calendar. (Default: =%B, %Y=.)\n\n<strong>wday_format</strong>:\n\n  [Strftime| php-function:strftime] style format string used to\n  generate the day-of-week names at the top of the calendar.\n\n<strong>start_wday</strong>:\n\n  What day of the week does the calendar start on. This should be\n  specified as an integer in the range zero (Sunday) through six\n  (Saturday), inclusive.\n\n  <?plugin Calendar start_wday=1 ?>\n\n-----\n\n! Patch for 1.2\n\nGaryBenson wrote the first calendar implementation for PhpWiki 1.2.\n(Since 1.2 doesn\'t support plugins, it uses a =###CALENDAR###= token\nas a trigger.) Gary provides a screenshot at [ http://inauspicious.org/files/screenshots/calender.png | screenshot ],\na [patch | http://inauspicious.org/files/phpwiki/phpwiki-1.2.0-calendar.patch] (on 1.2.0), and\n[calendar.php | http://inauspicious.org/files/phpwiki/calendar.php]\n(which renders a view of the year.)\n\n----\n\nPhpWikiDocumentation','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(19,1,1328031276,0,'<?plugin TitleSearch s=Category noheader=1 exclude=CategoryCategory?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(20,1,1328031276,0,'All links in this page will be used to find user groups for the\nWIKIPAGE group method.  User group pages must contain a list of\nusernames, and then for consistency after four hyphens a link to this\npage.\n\n* [Administrators]','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(22,1,1328031276,0,'!!! Synopsis\n\nThe CommentPlugin lets you hide parts of a Wiki page without actually\ndeleting the text. Comments will only be visible in the Wiki markup\nwhen editing or viewing the source.\n\n!!! Usage\n\nSimply place the text to be commented out between =<?plugin Comment=\nand =?>=:\n\n<verbatim>\n<?plugin Comment\n\n!!! A Hidden Section\n\nThis text will not show up in the generated HTML page, but it is still\nvisible when editing the WikiMarkup.\n\n?>\n</verbatim>\n\n!!! Author\n\nMartin Geisler mailto:gimpster@gimpster.com.\n\n<?plugin Comment\n\n!!! \"Fuzzy\" Logic\nTheorem: a cat has nine tails.\nProof:\n    No cat has eight tails. A cat has one tail more than no cat.\n    Therefore, a cat has nine tails.\n\n?>\n----\nWikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(23,1,1328031276,0,'<?plugin-form CreatePage ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(24,1,1328031276,0,'WikiPlugin to easily create new pages, optionally with default content. Since v1.3.8\n\nThis allows you to create a page geting the new pagename from a\nforms-based interface, and optionally with the initial content from\nsome template.\n\nPut a \"<~?plugin-form ~CreatePage ?~>\" at some page, browse this page,\nenter the name of the page to create, then click the button.\n\n!! Usage\n<verbatim>\n     <?plugin-form CreatePage ?>\n     <?plugin-form CreatePage template=CategoryHomePage ?>\n     <?plugin-form CreatePage template=SomeTemplatePage vars=\"year=2004&name=None\" ?>\n</verbatim>\n\n!! Plugin Arguments\n*s*: |\n  The pagename, which will passed to the plugin. Default: \"\"\n*initial_content*:  |\n  The new page will be pre-filled with this content. Default: \"\"\n*template*:  |\n  The new page will be pre-filled with the content of this page. Default: \"\"\n*vars*: |\n  variables to be expanded. Default: \"\"\n*overwrite*: |\n  Whether to overwrite an existing page. Default: \"\"\n\n!! Known Problems\n\nNone\n\n!! Variable Expansion\n\nThe content (either initial_content or template) might hold some variables, which will be\nexpanded on creation. Unassigned variables will stay as %%<var>%%, assigned variables without\nmatching %%<var>%% placeholder will be ignored, without any warning.\n\nA variable in a template is denoted as <tt>%%var%%</tt>, which will be expanded by the\nvalue of <tt>var</tt> given to the vars argument (in urlencoded php notation).\n\nSome special variables are automatically assigned:\n\n%%ctime%% |\n  $WikiTheme->formatDateTime(time())\n%%author%% |\n  $user->getId()\n\nThis forms together with page templates and the PhpWiki:WikiFormRichPlugin and\noptionally the PhpWiki:SqlResultPlugin a framework to create templated pages.\n\n!! Authors\n\nDan Frankowski, Reini Urban\n\n!! Examples\n\n<?plugin-form CreatePage s=MyHomePage ?>\n\nSee also PhpWiki:EasilyCreateNewPages, PhpWiki:WikiFormRichPlugin, PhpWiki:SqlResultPlugin\n\n-------------\n\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(26,1,1328031276,0,'<?plugin CreateToc jshide||=1 ?>\n\nWikiPlugin to create a dynamical *Table Of Contents* of all headers. Since v1.3.8\n\n!! Usage\n<verbatim>\n     <?plugin CreateToc ?>\n     <?plugin CreateToc jshide||=1 with_toclink||=1 ?>\n</verbatim>\n\n!! Plugin Arguments\n__jshide__: |\n  Boolean if the TOC should be initially hidden and on click expanded. Default: 0\n__with_toclink__:  |\n  Boolean if headers should link back to the TOC. Default: 0\n__headers__:  |\n  Which headers to include.  Default: !!!,!!,!    1,2,3 also allowed\n__noheader__:  |\n  Boolean if the \"Table of Contents\" h2 header should be omitted. Default: 0\n__liststyle__:  |\n  dl or ol or ul. Default: dl\n__indentstr__:  |\n  Default: &nbsp;&nbsp;\n__pagename__:  |\n  TOC of which page? Default: current pagename\n\n!! Known Problems\n\nIf any header contains a link or a ~WikiWord or non-word characters, ~CreateToc will print a warning and refuse to link this header.\n\n!! Examples\n\nSee for example PhpWikiDemo:en/TextFormattingRules\n-------------\n\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(27,1,1328031276,0,'Detailed view of a page, which is probably more useful for debugging\nthan anything else.\n\n<?plugin _BackendInfo page||=\'\' ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(28,1,1328031276,0,'<?plugin EditMetaData ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(29,1,1328031276,0,'<b>This plugin allows you to add/edit/delete metadata key/value pairs for a given page. You must be logged in as the administrator to do this. The page\'s metadata contains things like the page hit count, last edit time and so on.</b>\n\n<b>Editing the metadata for the homepage would look like this:</b>\n------\n<?plugin EditMetaData page=\"HomePage\" ?>\n------\n<b>With no arguments the plugin defaults to the current page:</b>\n------\n<?plugin EditMetaData ?>\n\n-----\n\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(30,1,1328031276,0,'Here are some good starting points for browsing.\n\n* HowToUseWiki gives you the quick lowdown on Wiki markup.\n* RecentChanges recorded automatically.\n* MoreAboutMechanics of browsing and editing on this server.\n\nHere\'s a title search. Try something like <tt>wiki or sandwich</tt>.\n\n<?plugin WikiFormRich action=TitleSearch method=GET nobr=1 class=wikiaction\n  editbox[] name=s text=\"\"\n  submit[]\n  checkbox[] name=case_exact\n  pulldown[] name=regex value=\"auto,none,glob,posix,pcre,sql\" ?>\n\nUse the following for a full text search. This takes a few seconds.\nThe results will show all lines on a given page which contain a\nmatch.\n\n<?plugin WikiFormRich action=FullTextSearch method=GET nobr=1 class=wikiaction\n  editbox[] name=s text=\"\"\n  submit[]\n  checkbox[] name=case_exact\n  pulldown[] name=regex value=\"auto,none,glob,posix,pcre,sql\" ?>\n\nIn a fuzzy pages search the titles of all pages are examined to find\nthose which are similarly spelled or similar sounding (english).\n\n<?plugin-form FuzzyPages ?>\n\n------\n\n! Tips\nSeparate words with a space. All words have to match as substrings. %%%\n\'OR\', grouping with parenthesis, string-quoting and some glob-style wildcard\ncharacters are also supported. %%%\nTo exclude words from a title search or full text search, prepend a \'-\'. %%%\nUse \'^xx\' or \'xx*\' to match words starting with \'xx\'. %%%\nUse \'~*xx\' or \'xx$\' to match words ending with \'xx\'. %%%\nUse \'^word$\' to match exact words. %%%\nUse regex=auto and \'re:\' like \'re:word.*xx\' or regex=posix to use posix regular expressions. (not yet) %%%\nUse regex=auto and \'//\' like \'/^word$/\' or regex=pcre to match using perl-style regular expressions. %%%\nUse regex=sql to match using SQL-style wildcards \'%\' and \'_\'. %%%\nUse regex=none to match any wildcards verbatim. %%%\n\nExample: \'wiki text -php\' looks for all pages containing the words \'wiki\' and \'text\',  %%%\n         but not containing the word \'php\'.','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(34,1,1328031276,0,'This plugin will create an HTML frame that will fill the entire display area of the page (that is, the whole area the user is allowed to edit). All other text will be discarded when the page is rendered (anything outside the call to plugin, that is). In the language of hypertext this is called <i>transclusion</i>.\n\nYou might also be interested in the IncludePagePlugin.\n\nExamples: to include a page from another site, use the <b>src</b> attribute:\n\n<verbatim>\n<?plugin FrameInclude src=\"http://phpwiki.org/\" ?>\n</verbatim>\n\nTo include a page from within this wiki, use the <b>page</b> attribute:\n\n<verbatim>\n<?plugin FrameInclude page=HomePage ?>\n</verbatim>\n\nFor more information on this plugin please read the PHP source code in the /lib/plugin directory.\n\n-----\n\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(36,1,1328031276,0,'Here\'s a list of all recently changed pages on this wiki, not just the\nmost recent ones found in RecentChanges. (See RecentEdits for all\nrecent minor edits and changes).\n\n--------\n\n<?plugin RecentChanges days||=3 show_all=1 daylist=1,3,7,30,90,-1 ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(38,1,1328031277,0,'<?plugin FullTextSearch ?>\n\n----\n\nAdditional Searches:\n<?plugin WikiFormRich action=TitleSearch method=GET nobr=1 class=wikiaction\n  editbox[] name=s text=\"\"\n  submit[]\n  checkbox[] name=case_exact\n  pulldown[] name=regex value=\"auto,none,glob,posix,pcre,sql\" ?>\n\n<?plugin WikiFormRich action=FullTextSearch method=GET nobr=1 class=wikiaction\n  editbox[] name=s text=\"\"\n  submit[]\n  checkbox[] name=case_exact\n  pulldown[] name=regex value=\"auto,none,glob,posix,pcre,sql\" ?>\n\n<?plugin WikiFormRich action=FuzzyPages method=GET nobr=1 class=wikiaction\n  editbox[] name=s text=\"\"\n  submit[]\n  checkbox[] name=case_exact ?>\n\n----\n\nCreate or edit page:\n\n<?plugin-form CreatePage?>\n\n----\n\n<?plugin IncludePage page=FindPage quiet=1 section=Tips sectionhead=1 ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(39,1,1328031277,0,'<?plugin FuzzyPages ?>\n\n----\n\nAdditional Searches:\n<?plugin-form TitleSearch?>\n<?plugin-form FullTextSearch?>\n<?plugin-form FuzzyPages?>\n\n----\n\nCreate or edit page:\n\n<?plugin-form CreatePage?>\n\n----\n\n<?plugin IncludePage page=FindPage quiet=1 section=Tips sectionhead=1 ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(40,1,1328031277,0,'A simple example plugin.\n\n<?plugin HelloWorld salutation=\"Hello,\" name=\"WikiUser\" ?>\n\nFrom the source of this page:\n\n<verbatim>\n<?plugin HelloWorld salutation=\"Hello,\" name=\"WikiUser\" ?>\n</verbatim>\n\n-----\nPhpWiki\'s plugin architecture allows you to add custom page elements to your wiki. All you have to do is extend (subclass) the ~WikiPlugin class and create your output via the run() method, dependend on the Wiki- or Request arguments,\n\n* either with the predefined HTML classes to create valid XHTML,\n* or by using templates, which are easier customizable, but generally more a mess to use and easier to create invalid XHTML.\n\n<?plugin PhpHighlight\n\n/**\n * A simple demonstration WikiPlugin.\n *\n * Usage:\n * <?plugin HelloWorld?&gt;\n * <?plugin HelloWorld\n *          salutation=\"Greetings, \"\n *          name=Wikimeister\n * ? >\n * <?plugin HelloWorld salutation=Hi ? >\n * <?plugin HelloWorld name=WabiSabi ? >\n */\n\n// Constants are defined before the class.\nif (!defined(\'THE_END\'))\n    define(\'THE_END\', \"!\");\n\nclass WikiPlugin_HelloWorld\nextends WikiPlugin\n{\n    // Five required functions in a WikiPlugin.\n\n    function getName () {\n        return _(\"HelloWorld\");\n    }\n\n    function getDescription () {\n        return _(\"Simple Sample Plugin\");\n\n    }\n\n    function getVersion() {\n        return preg_replace(\"/[Revision: $]/\", \'\',\n                            \"\\$Revision: 1.5 $\");\n    }\n\n    // Establish default values for each of this plugin\'s arguments.\n    function getDefaultArguments() {\n        return array(\'salutation\' => \"Hello,\",\n                     \'name\'       => \"World\");\n    }\n\n    function run($dbi, $argstr, $request) {\n        extract($this->getArgs($argstr, $request));\n\n        // Any text that is returned will not be further transformed,\n        // so use html where necessary.\n        $html = HTML::tt(fmt(\'%s: %s\', $salutation, WikiLink($name, \'auto\')),\n                         THE_END);\n        return $html;\n    }\n};\n?>\n-------------\n\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(35,1,1328031277,0,'This plugin will \"include\" other pages in this wiki. In the language of hypertext this is called <i>transclusion</i>. The pages will render in distinct tables. You can also load external pages in a more limited fashion with the FrameIncludePlugin. Examples:\n\n<?plugin IncludePage page=\"HomePage\" ?>\n\n<?plugin IncludePage page=\"WabiSabi\" ?>\n\n-----\n\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(43,1,1328031277,0,'The Inter Wiki map used on this wiki is listed below.  The map is taken\nfrom the text in the verbatim block below.  (But this only works if\nthis page is locked.)\n<verbatim>\nAIWiki http://www.ifi.unizh.ch/ailab/aiwiki/aiw.cgi?\nALife http://news.alife.org/wiki/index.php?\nAbbeNormal http://www.ourpla.net/cgi-bin/pikie.cgi?\nAcadWiki http://xarch.tu-graz.ac.at/autocad/wiki/\nAcronym http://www.acronymfinder.com/af-query.asp?String=exact&Acronym=\nAdvogato http://www.advogato.org/\nAnnotation http://bayle.stanford.edu/crit/nph-med.cgi/\nAnnotationWiki http://www.seedwiki.com/page.cfm?wikiid=368&doc=\nAviSynth http://www.avisynth.org/\nAwarenessWiki http://taoriver.net/aware/\nBcWireless http://www.bcwireless.net/wiki-moinmoin/moin.cgi/\nBenefitsWiki http://www.benefitslink.com/cgi-bin/wiki.cgi?\nBridgesWiki http://c2.com/w2/bridges/\nbsdWiki http://profile.sh/syswiki/index.php?\nC2find http://c2.com/cgi/wiki?FindPage&value=\nCLiki http://ww.telent.net/cliki/\nCache http://www.google.com/search?q=cache:\nCategory Category\nCmWiki http://www.ourpla.net/cgi-bin/wiki.pl?\nCreationMatters http://www.ourpla.net/cgi-bin/wiki.pl?\nCPAN http://search.cpan.org/\nDeWikiPedia http://de.wikipedia.org/wiki/\nDejaNews http://www.deja.com/=dnc/getdoc.xp?AN=\nDict http://www.dict.org/bin/Dict?Database=*&Form=Dict1&Strategy=*&Query=\nDictionary http://www.dict.org/bin/Dict?Database=*&Form=Dict1&Strategy=*&Query=\nDiveIntoOsx http://diveintoosx.org/\nDocBook http://docb