tp://wiki.cs.uiuc.edu/VisualWorks/\nWakkaWiki http://www.wakkawiki.com/\nWebDevWikiNL http://www.promo-it.nl/WebDevWiki/index.php?page=\nWebSeitzWiki http://webseitz.fluxent.com/wiki/\nWhy http://clublet.com/c/c/why?\nWiktionary http://wiktionary.org/wiki/\nWiki http://c2.com/cgi/wiki?\nWikiLens http://www.wikilens.org/wiki.php/\nWikiWikiWireless http://www.andaluciawireless.net/\nWikibooks http://wikibooks.org/wiki/\nWikiPedia http://www.wikipedia.com/wiki/\nWikiquote http://wikiquote.org/wiki/\nWikisource http://wikisource.org/wiki/\nWikiWorld http://WikiWorld.com/wiki/index.php/\nWikkiTikkiTavi http://tavi.sourceforge.net/\nWLUG http://www.wlug.org.nz/\nYpsiEyeball http://sknkwrks.dyndns.org:1957/writewiki/wiki.pl?\nZWiki http://www.zwiki.org/\nOsFaq2 http://www.mega-tokyo.com/osfaq2/index.php/\n</verbatim>\n','a:4:{s:8:\"pagetype\";s:12:\"interwikimap\";s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";}'),(176,1,1328031278,0,'Query any Wiki listed in the InterWikiMap by entering a desired page\nname below.\n\nTo add one of these searches to another page use the\nExternalSearchPlugin.\n\n<?plugin InterWikiSearch?>\n----\nWikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(178,1,1328031278,0,'LikePages are pages which share an initial or final word with that\npage. See also Wiki:LikePages and MeatBall:LikePages.\n\n----\n\n<?plugin LikePages ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(179,1,1328031278,0,'The ListPagesPlugin is the simpliest plugin to explicitly list a set of pages with all available\n[pagelist|PhpWiki:PageList] options, mainly used for a wikilens theme to display ratings info\nand recommendations.\n\nIt can also be used with the PhpWiki:PluginList method to list a set of pages generated by\nanother plugin, and/or to exclude a set of pages generated by another plugin.\n\nSee the PhpWiki:PageList options.\n\nUsage:\n<verbatim>\n  <?plugin ListPages pages=HomePage,FindPage,WikiWikiWeb ?>\n\n  <?plugin ListPages info=hits sortby=hits pages=<!plugin-list BackLink page=[] !> exclude=ListPagesPlugin,WikiPlugin ?>\n</verbatim>\n\n-------------\n\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(180,1,1328031278,0,'<?plugin MostPopular limit||=20 ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(181,1,1328031278,0,'The OldStyleTablePlugin can be used to include tables within a wiki\npage using the old-style markup syntax for tables.\n\n!!Usage:\n\n<verbatim>\n<?plugin OldStyleTable caption=\"OldStyleTable\" border||=2\n||^  *Name*                |v *Cost*   |v *Notes*\n| *First*     | *Last*\n|> Jeff       |< Dairiki   |^  Cheap   |< Not worth it\n|> Marco      |< Polo      | Cheaper   |< Not available\n?>\n</verbatim>\n\nwill get you\n\n<?plugin OldStyleTable caption=\"OldStyleTable\" border||=2\n||^  *Name*                |v *Cost*   |v *Notes*\n| *First*     | *Last*\n|> Jeff       |< Dairiki   |^  Cheap   |< Not worth it\n|> Marco      |< Polo      | Cheaper   |< Not available\n?>\n\nNote that multiple __|__s lead to spanned columns, and __v__s can be\nused to span rows.  A __>__ generates a right justified column, __<__\na left justified column and __^__ a centered column (which is the\ndefault.)\n\n!! Plugin Arguments\n\n__caption__:\n\n  Any string. Default: \"\"\n\n__border__:\n\n  Any number. Default: 1\n\n__cellspacing__:\n\n  Any number. Default: 1\n\n__cellpadding__:\n\n  Any number. Default: 1\n\n__summary__:\n\n  Any string. Default: \"\"\n\n----\n\nNote that within each table cell, _new-style_ markup is used.  You can\nonly use inline markup --- no block level markup is allowed within\ntable cells.\n\n(Using old-style markup wouldn\'t make much sense, since one can\'t\ninclude multi-line plugin invocations using the old-style markup\nrules.)\n\n\n-------------\n\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(182,1,1328031279,0,'! Synopsis\nOldTextFormattingRules%%%\n<strong>Emphasis:</strong> \'<strong></strong>\' for <em>italics</em>, _<em></em>~_ for <strong>bold</strong>, \'<strong></strong>\'_<em></em>~_ for <em><strong>both</strong></em>.%%%\n<strong>Lists:</strong> * for bullet lists, # for numbered lists, <em><strong>;</strong> term <strong>:</strong> definition</em> for definition lists.%%%\n<strong>References:</strong> ~JoinCapitalizedWords or use square brackets for a ~[page link] or URL ~[~http://cool.wiki.int/].%%%\n<strong>Footnotes:</strong> Use ~[1],~[2],~[3],...%%%\n<strong>Preventing linking:</strong> Prefix with \"~!\": ~!~DoNotHyperlink, name links like ~[~[text | URL] (double up on the \"[\").%%%\n<strong>Misc:</strong> \"~!\", \"~!~!\", \"~!~!~!\" make headings, \"%%<em></em>%\" makes a linebreak, \"-<em></em>-<em></em>-<em></em>-\" makes a horizontal rule.%%%\n<strong>Tables:</strong> | as first char, | for more columns, |> align right, |< align left, |^ centered (default), || span columns, |v span rows\n\n----\n! Paragraphs\n\n* Don\'t indent paragraphs\n* Words wrap and fill as needed\n* Use blank lines as separators\n* Four or more minus signs make a horizontal rule\n* %%<em></em>% makes a linebreak (in headings and lists too)\n\n\n! Lists\n\n* asterisk for first level\n     * asterisk-asterisk for second level, etc.\n* Use * for bullet lists, # for numbered lists (mix at will)\n* semicolon-term-colon-definition for definition lists:\n;term here:definition here, as in the <DL><DT><DD> list\n* One line for each item\n* Other leading whitespace signals preformatted text, changes font.\n\n! Headings\n\n* \'~!\' at the start of a line makes a small heading\n* \'~!~!\' at the start of a line makes a medium heading\n* \'~!~!~!\' at the start of a line makes a large heading\n\n! Fonts\n\n* Indent with one or more spaces to use a monospace font:\n\n<pre>\n This is in monospace\n</pre>\nThis is not\n\n!Indented Paragraphs\n\n* semicolon-colon -- works like <BLOCKQUOTE>\n\n;:this is an indented block of text\n\n! Emphasis\n\n* Use doubled single-quotes (\'<strong></strong>\') for emphasis (usually <em>italics</em>)\n* Use doubled underscores (_<em></em>_) for strong emphasis (usually <strong>bold</strong>)\n* Mix them at will: <strong><em>bold italics</em></strong>\n* <em>Emphasis</em> can be used <em>multiple</em> times within a line, but <em>cannot</em> cross line boundaries:\n\n\'\'this\nwill not work\'\'\n\n! References\n* Hyperlinks to other pages within the Wiki are made by placing the page name in square brackets: [this is a page link] or UsingWikiWords (preferred)\n* Hyperlinks to external pages are done like this: [http://www.wcsb.org/]\n* You can name the links by providing a name, a bar (|) and then the hyperlink or pagename: [PhpWiki home page | http://phpwiki.sourceforge.net/]  - [the front page | HomePage]\n* You can suppress linking to old-style references and URIs by preceding the word with a \'~!\', e.g. ~NotLinkedAsWikiName, ~http://not.linked.to/\n* You can create footnotes by using ~[1], ~[2], ~[3], ... like this here #[|ftnt_ref_1]<sup>~[[1|#ftnt_1]~]</sup>. See footnote for counterpart.  (If the ~[ is in the first column, it is a footnote <em>definition</em> rather than a footnote <em>reference</em> #[|ftnt_ref_1]<sup>~[[1|#ftnt_1]~]</sup>.)\n* Also, the old way of linking URL\'s is still supported: precede URLs with \"http:\", \"ftp:\" or \"mailto:\" to create links automatically as in: http://c2.com/\n* URLs ending with .png, .gif, or .jpg are inlined if in square brackets, by themselves: [http://phpwiki.sourceforge.net/demo/themes/default/images/png.png]\n\n! Tables\n\n* Simple tables are available.  A table row is introduced by a <strong>|</strong> in the first column.  It is best described by example:\n<pre>\n      ||  _<em></em>_Name_<em></em>~_               |v _<em></em>_Cost_<em></em>~_   |v _<em></em>_Notes_<em></em>~_\n      | _<em></em>_First_<em></em>~_   | _<em></em>_Last_<em></em>~_\n      |> Jeff       |< Dairiki   |^  Cheap     |< Not worth it\n      |> Marco      |< Polo      | Cheaper     |< Not available\n</pre>\n;:will generate\n<?plugin OldStyleTable\n||  <strong>Name</strong>               |v <strong>Cost</strong>   |v <strong>Notes</strong>\n| <strong>First</strong>   | <strong>Last</strong>\n|> Jeff       |< Dairiki   |^  Cheap     |< Not worth it\n|> Marco      |< Polo      | Cheaper     |< Not available\n?>\n\n;:Note that multiple <strong>|</strong>\'s lead to spanned columns, and <strong>v</strong>\'s can be used to span rows.  A <strong>></strong> generates a right justified column, <strong><</strong> a left justified column and <strong>^</strong> a centered column (which is the default.)\n;:With the new TextFormatingsRules tables are only supported with the OldStyleTablePlugin.\n\n\n! HTML Mark-Up Language\n\n* Don\'t bother\n* < and > are themselves\n* The & characters will not work\n* If you really must use HTML, your system administrator can enable this feature. Start each line with a bar (|). Note that this feature is disabled by default.\n\n! More detail than you want to know\n\nSee [MagicPhpWikiURLs] for gory details on how to write various kind of wiki maintainance links. (<em>deprecated</em>)\n\n-----\n\n! Footnotes:\n\n#[|ftnt_1]~[[1|#ftnt_ref_1]~]  By using ~[1] a second time (in the first column) the footnote itself is <em>defined</em>.  You may refer to a footnote as many times as you want, but you may only define it once on the page.  Note the the ~[1] in the footnote links back to the first reference, if there are multiple references there will be +\'s after the ~[1] which will link to the other references.  (References which come <em>after</em> the footnote <em>definition</em> will not be linked to.)\n----\nPhpWikiDocumentation','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(7,1,1328031279,0,'OrphanedPages are those pages which don\'t have any links to them.\n\n----\n\n<?plugin OrphanedPages info||=hits,pagename,mtime?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(187,1,1328031279,0,'View a wiki page in MIME format or download it as backup of a single\npage. _A complete dump of all pages can be produced in\nPhpWikiAdministration._\n\n<?plugin PageDump?>\n----\nEnter exact page name to dump:\n<?plugin-form PageDump?>\n\nTitleSearch:\n<?plugin-form TitleSearch?>\n\n----\nSee also: [ViewSource|phpwiki:?action=viewsource], PluginManager.','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(191,1,1328031279,0,'<?plugin PageHistory?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(192,1,1328031279,0,'<?plugin PageInfo?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(193,1,1328031279,0,'!!! Summary\nMakes an \'album\' by displaying a set of photos listed in a text file\nwith optional descriptions.\n\n!!! Usage\n<verbatim>\n<?plugin PhotoAlbum\n         src=http://server/textfile\n         mode=[column|row]\n         align=[center|left|right]\n         desc=true\n         sort=false\n         height=100%\n         width=100%\n         weblocation=>false\n?>\n</verbatim>\n\n!!! Arguments\n\'\'Only the =\'src\'= parameter is mandatory.\'\'\n\n__src__:\n  Url or local path to a CSV textfile which separates filename and\n  description of\n  each photo. Photos listed in the text file have to be in same\n  directory as the file. Descriptions are optional.\n  If the the local path points to a directory, is relative from PHPWIKI_DIR,\n  and the main script is in PHPWIKI_DIR, weblocation must not be given, and\n  all pictures from this directory are displayed.\n\n__weblocation__:\n  Optional path if the src points to a local dir, and the links on the\n  photos don\'t work.\n\n__mode__:\n  Specifies how the images are arranged, =\'column\'= means vertically,\n  =\'row\'= means horizontally. Default is =\'row\'=.\n\n__align__:\n  Only applicable to column mode. Default is =\'center\'=.\n\n__desc__:\n  Display any descriptions given in the text file. Default is true.\n\n__sort__:\n  Sort images by file name. By default the order in the text file is\n  followed.\n\n__height__, __width__:\n  Height and width are calculated compared to original metrics\n  retrieved by [php-function:getimagesize] and can be absolute or a\n  percentage (e.g. \"50%\").\n\n!!! Examples\n!! Text file\nPossible content of a valid text file:\n\n<verbatim>\nphoto-01.jpg; My girlfriend and I\nphoto-02.jpg\nchristmas.gif; Merry Christmas!\n</verbatim>\n\n!! Sample Album\nlocal dir:\n<?plugin PhotoAlbum\n         src=\"themes/Hawaiian/images/pictures/\"\n?>\nor via external url:\n<verbatim>\n<?plugin PhotoAlbum\n         src=\"http://phpwiki.sourceforge.net/demo/themes/Hawaiian/images/pictures/PhotoAlbum.csv\"\n</verbatim>\n?>\n\n!!! Plugin Author\n[Ted Vinke|mailto:teddy@jouwfeestje.com] <teddy@jouwfeestje.com>\n----\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(194,1,1328031279,0,'The PhpHighlightPlugin pretty-prints PHP code using the\nphp-function:highlight-string.\n\nSee also SyntaxHighlighterPlugin for highlighting other languages.\n\n!!! Usage\n\nYou specify options for the plugin on the same line as the =<?plugin=,\nand put the code on the following lines, until the final =?>=:\n\n<verbatim>\n<?plugin PhpHighlight [wrap?] [color options]\ncode to be highlighted\n?>\n</verbatim>\n\n!!! Description\n\nDepending on the =wrap= option, then the plugin will take care of\nadding =<?php= and =?>= to the code before passing it to\nphp-function:highlight-string. If the PHP delimiters were added, then\nthe plugin removes them again from the highlighted string, before\npresenting it.\n\n!!! Options\n\nAutomatic Wrapping:\n\n  If you don\'t want the plugin to automatically wrap the source code\n  in =<?php= and =?>=, then set =wrap= to =0=. The default value is =1=\n  which means that the plugin takes care of adding and removing\n  =<?php= and =?>= automatically.\n\n  If you set =wrap= to =0=, then you\'ll be able to mix PHP code with\n  HTML. The plugin will then translate \'=< ?php=\' into \'=<?php=\' and\n  \'=? >=\' into \'=?>=\' to allow you to start and stop PHP mode in your\n  code.\n\nColor Options:\n\n  The plugin accepts optional color arguments which correspond to the\n  highlight settings in *php.ini*. Specified colors must be a valid\n  hexadecimal color or\n  [HTML 4 color name|http://www.w3.org/TR/REC-html40/types.html#h-6.5]\n  in lowercase, such as =\'#0f0344\'= or =blue=. You can set the\n  following options:\n\n  =string=, =comment=, =keyword=, =bg=, =default=, and =html=\n\n!!! Examples\n\n!! PHP with default colors from =php.ini=:\n\n<?plugin PhpHighlight\nfunction hello() {\n    echo \"Hello World<p>\";\n}\n?>\n\n!! HTML with embedded PHP\n\nHere we have to use =wrap=0= to prevent automatic wrapping, and escape\n\'=?>=\' as \'=? >=\':\n\n<?plugin PhpHighlight wrap=0 html=\'#000000\' bg=\'#dddddd\'\n<html>\n  <head>\n    <title>PHP Test</title>\n  </head>\n  <body>\n    < ?php echo \"<p>Hello World</p>\\n\"; ? >\n  </body>\n</html>\n?>\n\n!! C Source\n\nAlthough =highlight_string()= was designed with PHP code in mind it is\nsuitable for basic syntax-highlighting of most C code because the two\nsyntax are similar.\n\n<?plugin PhpHighlight default=black string=blue comment=gray keyword=purple\n#include <stdio.h>\n/* Get load */\nint\ngetload(void)\n{\n    if ((fp = fopen(\"/proc/loadavg\", \"r\")) == NULL) {\n        syslog(LOG_ERR, _(\"%s %s: unable to open %s: %s\"), _(\"FATAL ERROR:\"),\n              \"getload()\", \"/proc/loadavg\", strerror(errno));\n        exit(EX_OSFILE);\n    }\n    fclose(fp);\n}\n?>\n\n!!! Authors\n\nMartin Geisler mailto:gimpster@gimpster.com and Carsten Klapp\nmailto:carstenklapp@users.sourceforge.net.\n\n-----\n\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(188,1,1328031279,0,'_*Note:*_  _Most of the actions on this page require administrative\nprivileges. They will not work unless you have set an admin username and\npassword in the PhpWiki config file._\n\n<?plugin CreateToc jshide||=1 with_toclink||=1 ?>\n\n----\n!!! Page Explorer\n\nFirst select pages and then define the action:\n\n<?plugin-form WikiAdminSelect s=\"*\" ?>\n\nor call the available ~WikiAdmin actions directly:\n\n[Remove | PhpWikiAdministration/Remove] |\n  [Rename | PhpWikiAdministration/Rename] |\n    [Replace | PhpWikiAdministration/Replace]\n\n\n----\n!!! Cleanup\n\nA Wiki SandBox is very easy to clean. Here you can restore it to\npristine condition by loading the default from pgsrc.\n\n  [Rake the SandBox|phpwiki:?action=loadfile&source=pgsrc/SandBox].\n\n----------\n\n!!! Making Snapshots or Backups\n\n!! ZIP files of database\n\nThese links lead to zip files, generated on the fly, which contain all\nthe pages in your Wiki. The zip file will be downloaded to your local\ncomputer.\n\n  This *[ZIP Snapshot | phpwiki:?action=zip]* contains only the\n  latest versions of each page, while this *[ZIP Dump |\n  phpwiki:?action=zip&include=all]* contains all archived versions.\n\n  (If the PhpWiki is configured to allow it, anyone can download a zip\n  file.)\n\nIf your php has _zlib_ support, the files in the archive will be\ncompressed, otherwise they will just be stored.\n\n!! Dump to directory\n\nHere you can dump pages of your Wiki into a directory of your choice.\n\n  <?plugin WikiForm action=dumpserial?>\n\nThe most recent version of each page will written out to the\ndirectory, one page per file. Your server must have write permissions\nto the directory!\n\n----\n\n!!! Dump pages as XHTML\n\n  <?plugin WikiForm action=dumphtml?>\n\nThis will generate a directory of static pages suitable for\ndistribution on disk where no web server is available. The various\nlinks for page editing functions and navigation are removed from the\npages.\n\n  The XHTML file collection can also be downloaded as an\n  *[XHTML ZIP Snapshot | phpwiki:?action=ziphtml]*.\n\n----\n\n!!! Phpwiki Internals\n\nThese are here mostly for debugging purposes (at least, that is the\nhope.)\n\nIn normal use, you should not need to use these, though, then again,\nthey should not really do any harm.\n\n!! Purge Markup Cache\n\n(If your wiki is so configured,) the transformed (almost-HTML) content\nof the most recent version of each page is cached. This speeds up page\nrendering since parsing of the wiki-text takes a fair amount of juice.\n\n  Hitting this button will delete all cached transformed\n  content. (Each pages content will be transformed and re-cached next\n  time someone views it.)\n\n  <?plugin WikiAdminUtils\n           action=purge-cache\n           label=\"Purge Cache\"\n   ?>\n\n!! Clean WikiDB of Illegal Filenames\n\nPage names beginning with the subpage-separator, usually a slash\n(=/=), are not allowed. Sometimes though an errant plugin or something\nmight create one....\n\n  This button will delete any pages with illegal page names, without possibility to restore.\n\n  <?plugin WikiAdminUtils\n           action=purge-bad-pagenames\n           label=\"Purge bad pagenames\"\n   ?>\n\n!! Clean WikiDB of empty and unreferenced pages\n\n  *Warning!* This button will delete every empty and unreferenced page, without any possibility to restore them again.\n  This will disable the possibility to revert or get back any deleted page.\n\n  <?plugin WikiAdminUtils\n           action=purge-empty-pages\n           label=\"Purge all empty unreferenced pages\"\n   ?>\n\n----\nPhpWikiDocumentation','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(196,1,1328031280,0,'<?plugin WikiAdminRemove ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(197,1,1328031280,0,'<?plugin WikiAdminRename ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(198,1,1328031280,0,'<?plugin WikiAdminSearchReplace ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(5,1,1328031280,0,'!! Contents\n\n<?plugin SiteMap\n         noheader=true\n         exclude=HomePage,PgsrcTranslation\n         reclimit=1\n         direction=forward\n         firstreversed=1\n?>\n\n! Pages in this category:\n\n<?plugin BackLinks\n         exclude||=\'\'\n         include_self||=1\n         noheader||=0\n         page||=[pagename]\n         info||=pagename,mtime\n?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(199,1,1328031280,0,'<?plugin WikiPoll require_all=0 require_least=2\n           question[1]=\"Do you like PhpWiki?\"\n             answer[1][1]=\"Yes\" answer[1][2]=\"Do not know\" answer[1][3]=\"No\"\n           question[2]=\"Do you have PhpWiki installed by your own?\"\n             answer[2][1]=\"Yes\" answer[2][2]=\"No\"\n           question[3]=\"Did you install any other wiki engine?\"\n             answer[3][1]=\"Yes\" answer[3][2]=\"No\"\n           question[4]=\"What wiki engine do you like most?\"\n             answer[4][1]=\"c2Wiki\" answer[4][2]=\"MoinMoin\" answer[4][3]=\"PhpWiki\"\n             answer[4][4]=\"usemod\" answer[4][5]=\"Twiki\" answer[4][5]=\"guiki\"\n             answer[4][6]=\"Other\"\n           question[5]=\"Which PhpWiki version do you use?\"\n             answer[5][1]=\"1.2.x\" answer[5][2]=\"1.3. 1-2\" answer[5][3]=\"1.3. 3-4\"\n             answer[5][4]=\"1.3. 5-8\"\n?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(190,1,1328031280,0,'PhpWiki lets you extend it with new functionality via a plugin\nmechanism. In short, you extend a PHP class we provide and customize\nit to print out the content you want. For more information see\nWikiPlugin, HelloWorldPlugin, and view the source of the files in\n<tt>lib/plugin</tt>.\n\nIf there is no example page for the plugin, or you need more\ninformation, the best place to go is the source of the plugin. Under\nyour wiki\'s root directory, the folder <tt>lib/plugin</tt> contains all the PHP\nfiles for the plugins.\n\n! External Requirements\nSome plugins require correctly configured PLUGIN_CACHED and external libraries\nnot provided with PhpWiki or PHP, such as\n* [PHP with GD support | php-function:ref.image] for the text2png plugin,\n* [LaTeX2HTML | ftp://ftp.dante.de/tex-archive/support/latex2html ] for the TexToPngPlugin and TeX2pngPlugin,\n* [graphviz | http://graphviz.org/] for the GraphVizPlugin and VisualWikiPlugin,\n* [ploticus | http://ploticus.sourceforge.net/] for the PloticusPlugin,\n* [phpweather | http://phpweather.sf.net] for the PhpWeatherPlugin,\n* [highlight | http://www.andre-simon.de/] for the SyntaxHighlighterPlugin,\n* a browser with [<iframe> support|http://www.cs.tut.fi/~jkorpela/html/iframe.html] for the TranscludePlugin,\n* USE_DB_SESSION = true (default for the peardb, adodb or dba backends) for the WhoIsOnline plugin,\n* --with-xml support (with expat or libxml2) for the ~RssFeed plugin (ProjectSummary, RecentReleases) and\n  HtmlParser support (ImportHtml, HtmlAreaEditing),\n* PHP Mail functionality (php.ini: SMTP + sendmail_from on Windows or sendmail_path) for email\n  PageChangeNotifications and ModeratedPage\'s,\n* a [Google license key | http://www.google.com/apis/] for the GooglePlugin,\n* optionally an external recommender engine (none yet, php only so far) and the wikilens theme for the RateIt plugin,\n* optionally apache/mod_log_{my}sql for fast, external log analysis if ACCESS_LOG_SQL=1 (Referer, Abuse Prevention).\n  See <tt>lib/Request.php</tt> and http://www.outoforder.cc/projects/apache/mod_log_sql/\n\n-----\n<?plugin PluginManager?>\n----\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(217,1,1328031280,0,'<?plugin RandomPage numpages||=20?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(32,1,1328031280,0,'Here\'s a list of recently changed pages on this wiki. (See RecentEdits\nfor all recent minor edits and changes).\n\n--------\n<?plugin RecentChanges days||=7 daylist=1,3,7,30,90,0 show_deleted||=1 ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(218,1,1328031280,0,'<?plugin RecentComments days||=7 daylist=1,3,7,30,90,0 ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(37,1,1328031280,0,'Here\'s a list of recently edited pages on this wiki. All minor changes\nare shown also, not just the most recent ones. (See RecentChanges for the\nmost recent non-minor changes).\n\n--------\n<?plugin RecentChanges days||=3 show_all||=1 show_minor=1 daylist=1,3,7,30,90,0 ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(209,1,1328031280,0,'<?plugin RssFeed url=http://sourceforge.net/export/rss2_projnews.php?group_id=6121&rss_fulltext=1 maxitem=10 ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(219,1,1045352818,0,'The RedirectToPlugin can be used to redirect a user to another page.\nIn other words it makes a page an _alias_ for another page.\n\n! Arguments\n\nUse only one of these arguments at a time.\n\npage |\n  The page to redirect to (a wiki page name).\nhref |\n  An external URL to redirect to.  Redirection to external URLs will only work\n  on locked pages.  (If the URL contains funny characters, you\'ll probably have\n  to put quotes around the URL.)\n\n! Caveats\n\nThe RedirectToPlugin invocation must be the first thing on a page.\nFor most purposes it makes any other content on the page inaccessible.\n\n! Example\n\nA page may be made a alias for the HomePage by placing this code at the top:\n<verbatim>\n<?plugin RedirectTo page=\"HomePage\" ?>\n</verbatim>\n\nTo see the example in action, visit HomePageAlias.\n-----\nPhpWikiDocumentation','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(221,1,1328031280,0,'<?plugin RelatedChanges show_minor||=1 days||=7 daylist=1,3,7,30,90,0 ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(222,1,1075205974,0,'RichTablePlugin is a plugin that takes off from the OldStyleTablePlugin. It allows a user to specify arbitrary properties of <tt><table></tt>, <tt><tr></tt> and <tt><td></tt> with a very simple markup.\n\nNEW: The plugin is now fixed so that the contents of each cell are individually processed by the ~BlockParser. This means that if everything works correctly,  you can do interesting things like put *invoke plugins*, use *enumerated lists* etc within each cell!\n\n*A <tt>\"-\"</tt> (dash) at the start of a new line represents a new row in the table.\n*A <tt>\"|\"</tt> (vertical bar or pipe) at the start of a new line represents a cell.\n*Attributes for the tags\n  *A line that starts with a <tt>\"*\"</tt> (star or asterisk) after a <tt>\"|\"</tt> is parsed for attributes for the corresponding cell.\n  *Attributes for the table are given on line that starts with a <tt>\"*\"</tt>, only if the line appears before any other line except whitespace.\n  *A line that starts with a <tt>-</tt> is always parsed for attributes since it can\'t have any content, unlike a cell.\n*Cell contents\n  *Cell contents are processed by the ~BlockParser.\n  *Any line that starts with a <tt>\"*\"</tt> anywhere other than the table attribute line is treated as normal content.\n  *Any line that starts with whitespace is also treated as content.\n  *Any cell line that does not have a <tt>\"*\"</tt> after the <tt>\"|\"</tt> is treated as normal content.\n  *All content lines that follow a cell line are added to that cell. They can contain arbitrary text except the above cases.\n  *If there is no cell in the current row, content lines are dropped silently.\n*The two special characters <tt>\"~~\"</tt> and <tt>\"?>\"</tt> should be escaped as <tt>\"\\~~\"</tt> and <tt>\"?\\>\"</tt>. I havn\'t discovered any other characters yet that might need to be escaped. This is required for the block parser to work.\n\nBugs:\n* The source code sucks\n* The plugin can\'t nest itself yet. Thus nested tables are currently not possible.\n\nExample:\n\n<?plugin RichTable\n\n*border=1, cellpadding=5, bgcolor=#f0f8f8, width=75%, align=center\n-\n|* colspan=3, align=center\nHomePage\n-\n|* colspan=2\n[http://phpwiki.sourceforge.net/demo/themes/default/images/png.png]\n|* rowspan=2\nThis cell actually has a plugin invocation inside it!\n<?plugin\nBackLinks\n?\\>\n- bgcolor=white\n|\n#One\n#Two\n|\n*Foo\n*Bar\n- bgcolor=cyan\nThis line gets dropped ... no cell to contain it!\n|* bgcolor=#f0f0ff, align=center\nOne paragraph\n\nAnother paragraph?\n|* align=left\nThis cell uses the row color\n| I wish this cell had a nested table inside it! :(\n?>\n\nThe above table is rendered from:\n\n<verbatim>\n<?plugin RichTable\n\n*border=1, cellpadding=5, bgcolor=#f0f8f8, width=75%, align=center\n-\n|* colspan=3, align=center\nHomePage\n-\n|* colspan=2\n[http://phpwiki.sourceforge.net/demo/themes/default/images/png.png]\n|* rowspan=2\nThis cell actually has a plugin invocation inside it!\n<?plugin\nBackLinks\n?\\>\n- bgcolor=white\n|\n#One\n#Two\n|\n*Foo\n*Bar\n- bgcolor=cyan\nThis line gets dropped ... no cell to contain it!\n|* bgcolor=#f0f0ff, align=center\nOne paragraph.\n\nAnother paragraph?\n|* align=left\nThis cell uses the row color\n| I wish this cell had a nested table inside it! :(\n?>\n</verbatim>\n\n;__Author__: Sameer D. Sahasrabuddhe\n;__Url__: http://www.it.iitb.ac.in/~sameerds/phpwiki/index.php/RichTablePlugin\n\n\n-------------\n\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"author\";s:10:\"ReiniUrban\";s:9:\"author_id\";s:10:\"ReiniUrban\";s:6:\"markup\";s:1:\"2\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(223,1,1328031280,0,'!! Synopsis\n\nA WikiPlugin to display external RSS feeds.\n\n!!  Usage\n<verbatim>\n  <?plugin RssFeed?>\n  <?plugin RssFeed url=http://somesite.tld/linktofeed.rss ?>\n</verbatim>\n\n!! Plugin Arguments\nArgument|\n  Default Value|\n    Description\n\nurl|\n  (empty)|\n    RSS Feed URL\n\nfeed|\n  (empty)|\n    RSS Feed Name\n\ndescription|\n  (empty)|\n    Description of the RSS Feed\n\nmaxitem|\n  0|\n    Max. number of entries (0 = unlimited)\n\n!! Sourcecode (since v1.3.8):\n* [PhpWikiCvs:lib/plugin/RssFeed.php]\n* [PhpWikiCvs:lib/RssParser.php] _fixed for allow_url_fopen=Off_\n\n!! Examples\n\n* PhpWikiRss _feed for PhpWiki:RecentChanges_\n<verbatim>\n  <?plugin RssFeed feed=PhpWikiRss description=\"PhpWiki:RecentChanges\"\n	           url=http://phpwiki.sourceforge.net/phpwiki/RecentChanges?format=rss ?>\n</verbatim>\n\n* [PhpWikiDemo:sidebar/]  _Example as sidebar box_\n\n-------------\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(225,1,1328031280,0,'<?plugin SearchHighlight ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(226,1,1328031281,0,'The SearchHighLight WikiPlugin is an internal actionpage plugin,\nwhich is only used internally.\n\nWhen someone is referred from a search engine like Google, Yahoo\nor our own fulltextsearch, the terms the user searched for are highlighted.\nSee also http://wordpress.org/about/shots/1.2/plugins.png\n\n!! Plugin Arguments\n__s__: |\n  The search term\n__case_exact__:  |\n  boolean.\n__regex__:  |\n  boolean.','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(195,1,1328031281,0,'The ~SyntaxHighlighter plugin passes all its arguments through a C++\nhighlighter called \"highlight\" (available at http://www.andre-simon.de/).\n\nAuthor: alecthomas\n\n! Arguments\nsyntax |\n  (required), See http://www.andre-simon.de/doku/highlight/highlight.html\nstyle |\n  ~[ \"ansi\", \"gnu\", \"kr\", \"java\", \"linux\" ~] (required)\ncolor |\n  null (optional), see =highlight/themes=\nnumber |\n  0  (optional)\nwrap |\n  0  (optional)\n\n\n! Example\n\n<verbatim>\n<?plugin SyntaxHighlighter syntax=c style=kr color=emacs\n #include <stdio.h>\n\n int main() {\n printf(\"Lalala\\n\");\n }\n?>\n</verbatim>\n\n=>\n\n<?plugin SyntaxHighlighter syntax=c style=kr color=emacs\n #include <stdio.h>\n\n int main() {\n printf(\"Lalala\\n\");\n }\n?>\n\nI did not use beautifier, because it used up more than 8M of memory on\nmy system and PHP killed it. I\'m not sure whether this is a problem\nwith my integration, or with beautifier itself.\n\nFixes by Reini Urban:\n* support options: syntax, style, color.\n* php version switch\n* HIGHLIGHT_DATA_DIR, HIGHLIGHT_EXE constants\n----\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(228,1,1328031281,0,'<noinclude>\nThe following predefined variables are automatically expanded if existing:\n  pagename\n  mtime     - last modified date + time\n  ctime     - creation date + time\n  author    - last author\n  owner\n  creator   - first author\n  SERVER_URL, DATA_PATH, SCRIPT_NAME, PHPWIKI_BASE_URL and BASE_URL\n</noinclude>\n\nTitle: %%title%%   Year: %%year%%\n---\n* Pagename: %%pagename%%\n* Author: %%author%%\n* Last modified time: %%mtime%%\n* Created time: %%ctime%%\n* Owner: %%owner%%\n* Creator: %%creator%%\n\n* SERVER_URL: %%SERVER_URL%%\n* DATA_PATH: %%DATA_PATH%%\n* SCRIPT_NAME: %%SCRIPT_NAME%%\n* PHPWIKI_BASE_URL: %%PHPWIKI_BASE_URL%%\n* BASE_URL: %%BASE_URL%%','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(229,1,1328031281,0,'!! Synopsis\n\nTemplate = Parametrized blocks.\n\nInclude text from a wiki page and replace certain placeholders by parameters.\nSimiliar to CreatePage with the template argument, but at run-time.\nSimiliar to the mediawiki templates but not with the \"|\" parameter seperator.\n\n!!  Usage\n<verbatim>\n  <?plugin Template page=Templates/Footer?>\n  <?plugin Template page=Templates/Film vars=\"title=SomeFilm&year=1999\" ?>\n  {{Templates/Film|title=SomeFilm|year=1999}}\n</verbatim>\n\n!! Plugin Arguments\nArgument|\n  Default Value|\n    Description\n\npage|\n  (empty)|\n    pagename to be included as template\n\nvars|\n  (empty)|\n    optional parameters to be expanded inside the template\n\n! Parameter expansion:\n  vars=\"var1=value1&var2=value2\"\n\nWe only support named parameters, not numbered ones as in mediawiki, and\nthe placeholder is %%var%% and not {{~{var~}}} as in mediawiki.\n\nThe following predefined variables are automatically expanded if existing:\n<verbatim>\n  pagename\n  mtime     - last modified date + time\n  ctime     - creation date + time\n  author    - last author\n  owner\n  creator   - first author\n  SERVER_URL, DATA_PATH, SCRIPT_NAME, PHPWIKI_BASE_URL and BASE_URL\n</verbatim>\n\n<noinclude> .. </noinclude> is stripped\n\n! In work:\n* ENABLE_MARKUP_TEMPLATE = true: (lib/InlineParser.php)\n  Support a mediawiki-style syntax extension which maps\n<verbatim>\n    {{TemplateFilm|title=Some Good Film|year=1999}}\n</verbatim>\n  to\n<verbatim>\n    <?plugin Template page=TemplateFilm vars=\"title=Some Good Film&year=1999\" ?>\n</verbatim>\n\n!! Examples\n\n<verbatim>\n  <?plugin Template page=TemplateExample vars=\"title=TestTitle\" ?>\n</verbatim>\n\nStandard syntax:\n  <?plugin Template page=TemplateExample vars=\"title=TestTitle\" ?>\n\nShorter syntax:\n  {{TemplateExample|title=TestTitle}}\n\n-------------\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(232,1,1328031281,0,'<?plugin CreateToc jshide||=1 with_toclink||=1 ?>\n----\n! Synopsis\n*Emphasis:* <tt>~_</tt> for _italics_, <tt>~*</tt> for *bold*,\n<tt>~_~*</tt> for _*both*_, <tt>~=</tt> for =fixed width=.%%%\n*Lists:* <tt>~*</tt> for bullet lists, <tt>#</tt> for numbered lists,\n_Term<b>:</b>~<new-line> definition_ for definition lists.%%%\n*Preformatted text:* Enclose text in <tt>~<pre>~</pre></tt> or\n<tt>~<verbatim>~</verbatim></tt>.%%%\n*Indented text:* Indent the paragraph with whitespaces.%%%\n*References:* ~JoinCapitalizedWords or use square brackets for a\n<tt>~[page link]</tt> or URL <tt>~[~http://cool.wiki.int/]</tt>.%%%\n*Preventing linking:* Prefix with \"<tt>~~</tt>\":\n<tt>~~~DoNotHyperlink</tt>, name links like <tt>~[text | URL]</tt>.%%%\n*Misc:* \"<tt>!</tt>\", \"<tt>!!</tt>\", \"<tt>!!!</tt>\" make headings,\n\"<tt>~%%%</tt>\" or \"<tt>~<br></tt>\" makes a linebreak,\n\"<tt>~----</tt>\" makes a horizontal rule.%%%\n*Allowed HTML tags:* <b>b</b> <big>big</big> <i>i</i>\n<small>small</small> <tt>tt</tt> <em>em</em> <strong>strong</strong>\n<abbr>abbr</abbr> <acronym>acronym</acronym> <cite>cite</cite>\n<code>code</code> <dfn>dfn</dfn> <kbd>kbd</kbd> <samp>samp</samp>\n<var>var</var> <sup>sup</sup> <sub>sub</sub>\n\n----\n\n!!! Character Formatting\n\n* All special non-whitespace HTML characters are displayed as-is. Exceptions below.\n* See [Emphasis|TextFormattingRules#Emphasis].\n* There\'s no syntax for font tags or color attributes.\n* The tilde \'~~\' is the _Escape Character_:\n** A single tilde \'~~\' followed by nothing gets rendered as a single tilde. => ~\n** Two tilde \'~~~~\' get rendered as a single tilde. => ~~\n** A single tilde before a link (\'~~http~:~/~/foo.bar\') prevents linking.\n   => ~http://foo.bar\n** Two tildes before a link (\'~~~~http~:~/~/foo.bar\') produce a tilde\n   followed by the hyperlinked URL.\n   => ~~http://foo.bar\n** A tilde inside an URL gets removed, unless it\'s formatted inside\n   ~[ ~] brackets.\n   Two tildes inside an URL (without brackets) become a single tilde.\n   => [http://foo.bar/~user] or http://foo.bar/~~user\n* Special non-ascii or non-latin characters are printed as-is only if supported\n  by the native wiki CHARSET. Add such characters on a non-supported CHARSET with the RawHtmlPlugin if it is enabled by the Admin and e.g. the &#num; syntax. %%%\n  E.g. These japanese euc-jp chars \'&#12363;&#12425; &#26032;&#35215;&#12506;&#12540;&#12472;\' on this =<?plugin SystemInfo CHARSET?>= wiki.\n  And with the plugin: <?plugin RawHtml &#12363;&#12425; &#26032;&#35215;&#12506;&#12540;&#12472; ?> %%%\n  And this is how it should like: [http://phpwiki.sourceforge.net/demo/images/chars-releasenotes-japanese.png]\n\n!!! Paragraphs\n\n* Don\'t indent paragraphs\n* Words wrap and fill as needed\n* Use blank lines as separators\n* Four or more minus signs make a horizontal rule\n* =~%%%= or =~<br>= makes a linebreak (in headings and lists too)\n\n\n!!! Lists\n\n* asterisk for first level\n  * indented asterisk (indent at least two spaces) for second level, etc.\n* Use <tt>~*</tt>, <tt>-</tt>, <tt>+</tt> or <tt>o</tt> for bullet\n  lists, <tt>#</tt> for numbered lists (mix at will)\n* Definition lists:\n  <pre>\n  Term:\n    definition\n  </pre>\n  gives\n  Term:\n    definition\n  as in the =<DL><DT><DD>= list\n* Items may contain multiple paragraphs and other multi-lined content,\n  just indent the items\n\n\n!!! Headings\n\n* \'=!=\' at the start of a line makes a small heading\n* \'=!!=\' at the start of a line makes a medium heading\n* \'=!!!=\' at the start of a line makes a large heading\n\n\n!!! Preformatted text\n\n* Place preformatted lines inside =~<pre>=:\n  <verbatim>\n  <pre>\n  Preformatted text. WikiLinks still work.\n  </pre>\n  </verbatim>\n  gives\n  <pre>\n  Preformatted text. WikiLinks still work.\n  </pre>\n* If you want text with no Wiki interaction, use the =~<verbatim>= tag:\n  <pre>\n  <verbatim>\n  Preformatted text. ~WikiLinks do not work.\n  </verbatim>\n  </pre>\n  gives\n  <verbatim>\n  Preformatted text. WikiLinks do not work.\n  </verbatim>\n\n\n!!!Indented Paragraphs\n\n* Two or more whitespaces signal indented text. Indents may be nested.\n\n    This is an indented block of text.\n\n      This block is even more indented.\n\n* E-mail style block-quoting is supported as well:\n  <pre>\n  > This is block-quoted text.\n  </pre>\n  renders as\n\n  > This is block-quoted text.\n\n\n!!! Emphasis\n\n* Use an underscore (<tt>~_</tt>) for emphasis (usually _italics_)\n* Use an asterisk (<tt>~*</tt>) for strong emphasis (usually *bold*)\n* Mix them at will: *_bold italics_*\n* _Emphasis_ can be used _multiple_ times within a paragraph, but\n  _cannot_ cross paragraph boundaries:\n\n  _this\n\n  will not work_\n\n!!! References\n\n* Hyperlinks to other pages within the Wiki are made by placing the\n  page name in square brackets: [this is a page link] or\n  UsingWikiWords (preferred)\n* Hyperlinks to external pages are done like this:\n  [http://www.wcsb.org/]\n* You can name the links by providing a name, a bar (|) and then the\n  hyperlink or pagename:\n  [PhpWiki home page | http://phpwiki.sourceforge.net/] ---\n  [the front page | HomePage]\n* You can suppress linking to old-style references and URIs by\n  preceding the word with a \'<tt>~~</tt>\', e.g. ~NotLinkedAsWikiName,\n  ~http://not.linked.to/\n* Also, the old way of linking URL\'s is still supported: precede URLs\n  with \"<tt>http:</tt>\", \"<tt>ftp:</tt>\" or \"<tt>mailto:</tt>\" to\n  create links automatically as in: http://c2.com/\n* URLs ending with =.png=, =.gif=, or =.jpg= are inlined if in square\n  brackets, by themselves.\n* In-page #[hyperlinks] are made by placing a named anchor and\n  referring to the anchor in a hyperlink:\n  * Named anchors:\n    * <tt>~#~[foo]</tt>: An anchor around the text \"foo\" with id\n      \"foo\".\n    * <tt>~#~[|foo]</tt>: An empty anchor with id \"foo\".\n    * <tt>~#~[howdy|foo]</tt>: An anchor around the text \"howdy\" with\n      id \"foo\".\n  * References to name anchors are made thusly:%%%\n    <tt>~[~#[#hyperlinks]]</tt>, <tt>~[~OtherPage#foo]</tt>,\n    <tt>~[named|~OtherPage#foo]</tt>.\n\n\n!!! Tables\n\n* Definition list style tables are written just like definition lists,\n  except that you replace the trailing colon on the term with a \"pipe\"\n  (<tt>|</tt>).\n\n  <pre>\n  Term 1 |\n     Definition 1 begins here.\n     Term 1.1 |\n        Definition 1.1\n     Term 1.2 |\n        Definition 1.2\n     This is part of definition 1.\n  Term 2 |\n     Here\'s definition 2.\n  </pre>\n\n  Term 1 |\n     Definition 1 begins here.\n     Term 1.1 |\n        Definition 1.1\n     Term 1.2 |\n        Definition 1.2\n     This is part of definition 1.\n  Term 2 |\n     Here\'s definition 2.\n\n* Old-style tables are supported through the OldStyleTablePlugin:\n\n!!! HTML Mark-Up Language\n\n* Some in-line markup is allowed through the use of HTML tags:\n  <b>b</b>, <big>big</big>, <i>i</i>, <small>small</small>,\n  <tt>tt</tt>, <em>em</em>, <strong>strong</strong>,\n  <abbr>abbr</abbr>, <acronym>acronym</acronym>, <cite>cite</cite>,\n  <code>code</code>, <dfn>dfn</dfn>, <kbd>kbd</kbd>,\n  <samp>samp</samp>, <var>var</var>, <sup>sup</sup> and <sub>sub</sub>\n* < and > are themselves\n* The & characters will not work\n\n!!! Creating various kinds of special links\n\n* See [MagicPhpWikiURLs] for gory details on how to write various kind\n  of wiki maintenance and other special links.\n\n!!! Inserting plugins\n\n* Several plugins permit embedding additional functionality to Wiki\n  pages. For example,\n  <verbatim>\n  <?plugin BackLinks page=HomePage info=hits ?>\n  </verbatim>\n  gives\n  <?plugin BackLinks page=HomePage info=hits ?>\n\n* For more information on plugins see WikiPlugin, and PluginManager for a list of all\n  plugins.\n\n----\n\nPhpWikiDocumentation','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(189,1,1328031281,0,'<?plugin TitleSearch ?>\n\n----\n\nAdditional Searches:\n<?plugin WikiFormRich action=TitleSearch method=GET nobr=1 class=wikiaction\n  editbox[] name=s text=\"\"\n  submit[]\n  checkbox[] name=case_exact\n  pulldown[] name=regex value=\"auto,none,glob,posix,pcre,sql\" ?>\n\n<?plugin WikiFormRich action=FullTextSearch method=GET nobr=1 class=wikiaction\n  editbox[] name=s text=\"\"\n  submit[]\n  checkbox[] name=case_exact\n  pulldown[] name=regex value=\"auto,none,glob,posix,pcre,sql\" ?>\n\n<?plugin WikiFormRich action=FuzzyPages method=GET nobr=1 class=wikiaction\n  editbox[] name=s text=\"\"\n  submit[]\n  checkbox[] name=case_exact ?>\n\n----\n\n<?plugin IncludePage page=FindPage quiet=1 section=Tips sectionhead=1 ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(206,1,1328031281,0,'The TranscludePlugin can be used to embed include whole (external) web\npages within a wiki page.\n\n! Plugin Arguments\n\n=src= |\n  The URL of the page to transclude\n=height= |\n  The (initial) height of the transclusion frame.\n  If, possible, after the transcluded page is loaded,\n  the frame is resized via javascript so that it\n  fits the entire transcluded page.  (See below for more.)\n\n! Bugs / Caveats\n\no Pages are transcluded using =<iframe>= tags.  Older browsers do not\n  support \'\'iframe\'\'s.  In that case the user will be presented with a\n  link to the trancluded material.\n\no When possible, JavaScript code is used to adjust the height of the\n  _iframe_ so that it fits the entire transcluded page.\n  Unfortunately, this seems possible only when the transcluded page\n  comes from the same server as the wiki page.  (This restriction is\n  due to security checks built in to the JavaScript language.)\n\no The recursion detection code does not currently work.  Be careful to\n  avoid recursive transclusions, or you\'ll be sorry (or at least\n  amused.)\n\n! Example\n\n<verbatim>\n<?plugin Transclude src=\"http://phpwiki.sourceforge.net/demo/ChangeLog\" ?>\n</verbatim>\n\nwill get you\n\n<?plugin Transclude src=\"http://phpwiki.sourceforge.net/demo/ChangeLog\" ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(236,1,1328031282,0,'The ~UnfoldSubpages WikiPlugin is used to display all or some subpages\nof the current or a given page.  This gives a overview for a\nWikiBlogPlugin, CalendarPlugin or similar subpages.\n\nWarning: Don\'t use it with subpages with non-existant sections!\nThe section extractor is currently quite unstable.\n\n! Usage:\n<verbatim>\n     <?plugin UnfoldSubpages ?>\n  or <?plugin UnfoldSubpages sortby=-mtime words=50 maxpages=5 ?>\n  or <?plugin UnfoldSubpages quiet=1 smalltitle=1 ?>\n  or <?plugin UnfoldSubpages sections=2 words=100 ?>\n  or <?plugin UnfoldSubpages lines=3 ?>\n  or <?plugin UnfoldSubpages pagename=\"PhpWikiAdministration\"\n              section=\"Plugin Arguments\" sectionhead=1 ?>\n</verbatim>\n\n!! Plugin Arguments:\n<strong>pagename</strong>:\n  Any pagename or if empty the current page. Default: \"\"\n<strong>quiet</strong>:\n  Print no header.  Default: false\n<strong>sortby</strong>:\n  Sort by + (ASC) or - (DESC) and one column.\n  Multiple columns like sortby=\"-hits,-mtime\" not yet supported.\n  Supported columns: ~[+|-]pagename, ~[+|-]mtime, ~[+|-]hits.\n  Default: \"pagename\"\n<strong>maxpages</strong>:\n  Maximum number of pages to include or all if not defined.\n  Default: false\n<strong>sections</strong>:\n  Maximum number of sections per page to include or all if not defined.\n  Default: false\n<strong>section</strong>:\n  Include this named section per page only if defined. Default: \"\"\n<strong>sectionhead</strong>:\n  When including a named section show the heading. Default: false\n<strong>smalltitle</strong>:\n  If set, hide transclusion-title, just have a small link at the start of\n  the page. Default: false\n<strong>words</strong>:\n  Maximum number of words per page to include. Default: false\n<strong>lines</strong>:\n  Maximum number of lines per page to include. Default: false\n<strong>bytes</strong>:\n  Maximum number of bytes per page to include. Default: false\n\n! Deprecated Arguments:\n<strong>pages</strong>:\n  deprecated. renamed to maxpages.\n<strong>sort</strong>:\n  \'asc\' or \'desc\'. deprecated: use \"+\" or \"-\" before the column name with sortby.\n\n! Example:\n<?plugin UnfoldSubpages pagename=PgsrcTranslation limit=20 ?>\n\n-------------\n\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(238,1,1328031282,0,'__Upload a file which will be accessible by typing:__\n<verbatim>\nUpload:num_rev/filename\n</verbatim>\n----\n<?plugin UpLoad ?>\n----','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(239,1,1328031282,0,'<?plugin UserPreferences?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(240,1,1328031282,0,'Here is a list of pages that have been cited on this wiki but are not\nyet written. Although they appear to be wanted, they may be\nmisspellings of existing pages or pages too trivial to merit creation.\n\nThe best course of action for these pages isn\'t necessarily to create\na page. Often, it is better to change the references so they are no\nlonger ~WikiNames. Where applicable, you can just change the case, add\nspaces or insert an escape character ~~.\n\n----\n\n<?plugin WantedPages?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(241,1,1328031282,0,'<?plugin WikiAdminSelect s||=\"*\" ?>','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(237,1,1328031282,0,'This simple plugin allows blog-style entries on a page. Try making a few entries, and then look at RecentChanges to get an idea of how things work.\n\n<?plugin WikiBlog ?>\n\n\n-------------\n\nPhpWikiDocumentation WikiPlugin','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(4,1,1328031282,0,'Since PhpWiki-1.3.3 support for ~WikiPlugins is included.\n\nA plugin is some PHP code that\n\n* lives in =phpwiki/lib/plugin/<pluginname>.php=\n* implements the ~WikiPlugin interface by extending that class.\n\nThere are many plugins already distributed with PhpWiki. Simply look in the =lib/plugin=\ndirectory or see the PluginManager list.\n\nTo write your own, look at the HelloWorldPlugin (~HelloWorld.php in that directory),\nwhich is a minimal example of a plugin.\nPublish your self-written plugin at a new PhpWiki page with ~PluginName + *Plugin* appended\nand add a link to [CategoryContributedPlugin | PhpWiki:CategoryContributedPlugin].\n\nA WikiPlugin allows one to easily add new types of dynamic content\n(as well as other functionality) to wiki pages within PhpWiki.\nIn this very wiki all actions which are not entirely lowercased\nare implemented using plugins, and some lowercased convenience actions also. (rename, revert, setacl, diff, ...)\n\n(The old-style [MagicPhpWikiURLs] have been replaced by plugins entirely.)\n\n!!!Example\n\nCurrently, one invokes a plugin by putting something like:\n\n<verbatim>\n<?plugin AllPages limit=5?>\n</verbatim>\n\ninto a regular wiki-page.  That particular example produces a list of\nthe first 5 existing pages (via the ~PageList library).\n\n<?plugin AllPages limit=5 ?>\n\n!!!Details\n\nPlugins can take certain named arguments (most do).  The values of\nthese arguments can be determined four different ways.  In order of\nprecedence:\n\n# The plugin invocation can specify the value for an argument, like so:\n  <verbatim>\n  <?plugin BackLinks page=OtherPage ?>\n  </verbatim>\n\n# The argument can be specified via an HTTP query argument.  This\n  doesn\'t happen (is not allowed) unless the argument is mentioned in\n  the plugin invocation:\n\n  <verbatim>\n  <?plugin BackLinks page ?>\n  </verbatim>\n\n# Default values specified in the plugin invocation:\n\n  <verbatim>\n  <?plugin BackLinks page||=OtherPage ?>\n  </verbatim>\n\n# The plugin must supply default values for each argument it uses.\n  Such default args may be overriden by URL arguments like so:\n  <verbatim>\n    BackLinks?page=ThisPage&sortby=-mtime\n  </verbatim>\n  (The BackLinks plugin uses the current page as the default value for\n  the \'\'page\'\' argument.)\n\n  Most plugins using the ~PageListLibrary inherit their default arguments\n  from the PhpWiki:PageListLibrary.\n\n!! Standard Arguments\n\nMost plugins display a list of pages, via the ~PageListLibrary.\n~PageList provides automatic support for those arguments.\n\n  info, exclude, author, owner, creator, sortby, limit, paging, cols, azhead,\n  comma, commasep, ordered\n\n  For details see the PhpWiki:PageListLibrary documentation.\n\n*exclude* and *pages* accept a list of pages. Either as comma-seperated list,\nsupporting glob-style wildcards, or via the <tt><!plugin-list pluginname ~[args~] !></tt>\ninvocation syntax, where pluginname might be any plugin returning a pagelist.\nSee PhpWiki:PluginList.\n\n!! Basic Plugin Types\n\nAll these plugins derive from the WikiPlugin class extending the run method,\nwhich returns a object tree of HTML objects, and may react on any\nprovided arguments from the ~WikiPage (see the args below) or\noptionally overridden by arguments from the url (GET or POST args),\nif defined via \'||=\'.\n\nA basic plugin just needs the run() method, and optionally getName,\ngetDescription, getVersion, getDefaultArguments. See the HelloWorldPlugin for a short introduction.\n\n  *plugin* reacts on its arguments and the request and displays arbitrary HTML.\n\n  *plugin-form* is used to display a input type=text box for the default argument *s*.\n\n  *plugin-list* is used as argument to provide a dynamic list of pagenames.\n\n  <verbatim>\n    <?plugin PluginName [args...] ?>\n  </verbatim>\n\n  <verbatim>\n    <?plugin-form PluginName [args...] ?>\n  </verbatim>\n\n  <verbatim>\n    <?plugin PluginName args=<!plugin-list pluginname [args] !> ?>\n  </verbatim>\n\n! The box Method\n\nThemes based on the \"sidebar\" theme may use the box method of any plugin, which displays a *title*\nand a condensed *content* in a box.\n\n! ~WikiPluginCached\n\nPlugins deriving from the class ~WikiPluginCached must also define the methods getPluginType(),\noptionally getExpire(), managesValidators(), and dependent of the getPluginType the methods\nto display the *possibly cached* result.\n\n  getImage(), getMap() or getHtml(),\n\noptionally also\n\n  getAlt(), getImageType(), embedMap(), embedImg(), embedObject()\n\nSee the config.ini PLUGIN_CACHED_* settings and PhpWiki:WikiPluginCached\n\n!! Action Pages\n\nThe term *~ActionPage* refers to a page containing a plugin invocation.\nAn *action* is together with the *pagename* argument the a basic PhpWiki argument.\nIt can both be GET or POST actions. Actions are untranslated, always english.\nBasic (and old) actions are all lowercase, like edit, browse, remove, ...\nNewer actions in PhpWiki:CamelCase are invoked via plugins on their specific action page.\n\nWe decoupled actions from plugins via action pages for the following reasons:\n\n# support translated action buttons and customizable action descriptions.\n# customize standard actions by tuning the plugin invocation arguments. override or add plugin defaults.\n# split simple plugins into multiple actions, like RecentChanges/RecentEdits, MostPopular/LeastPopular,\n  AllPages/AllPagesCreatedByMe/AllPagesLastEditedByMe/AllPagesOwnedByMe which differ only in one argument.\n\n* Those actions which have buttons or links in the theme or are referenced in the standard pgsrc\n  pageset require their (possibly localized) actionpages, otherwise the actions will not work.\n* If the localized actionpage is not found the english version is used.\n* If no actionpage is found, it is recommended to do action=upgrade, which imports all missing\n  and required action pages into the database.\n\nSo for a hypothetical new ~MyActionPage plugin ~MyActionPage will invoke the plugin and\n~MyActionPagePlugin is the the description.\n\n!!! Existing Plugins\n\nSee PluginManager for a detailed list. Most plugins should have their own description page with the name\n*Plugin* appended.\n\n<?plugin BackLinks noheader=1 ?>\n\n!!! Contributed Plugins\n\nSee PhpWiki:CategoryContributedPlugin.\n\n<?plugin Backlinks page=CategoryContributedPlugin ?>\n\n-----\nPhpWikiDocumentation','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}'),(41,1,1328031282,0,'* Use the SandBox page to experiment with Wiki pages.\n* See RecentChanges for the latest page additions and changes.\n* Find out which pages are MostPopular.\n* See more PhpWikiDocumentation.','a:4:{s:6:\"markup\";s:1:\"2\";s:6:\"author\";s:28:\"The PhpWiki programming team\";s:9:\"author_id\";s:28:\"The PhpWiki programming team\";s:8:\"pagetype\";s:8:\"wikitext\";}');
